import React from 'react';

const ToDoList = () =>{
    return (
         <>
             <div className="main_div">
                 <div className='center_div'>
                 <br />
                 <h1>ToDo List</h1>
                 <br />
                 <input type="text" placeholder="Enter Data" />

                 </div>
             </div>
         </>
    )
}

export default ToDoList;
